import React from 'react';
import './css/NavigationBar.css';

function NavigationBar() {
    return (
        <ul>
            <li><a>Home</a></li>
            <li><a>News</a></li>
            <li><a>Contact</a></li>
            <li><a>About</a></li>
        </ul> 
    )
}

export default HeroHeader;
